import React, { Component } from "react";
import Menu from "../../menu/menu";


export default class activateExts extends Component {


    render(){
        return (
            <div className="mainDiv">
                <div className="menu">
                    <Menu />
                </div>
                <p>Ativar Ramais</p>
                <div className="doBackup">
                        <h2>Período para Backup</h2>
                        <div className="finders">
                            <Select
                                className="selected"
                                value={periodSelected}
                                onChange={this.periodChange}
                                options={period}
                                placeholder="Selecione o Período"
                                isSearchable />
                            <button className="doBackup" onClick={this.handleSubmit}>Backup</button>
                        </div>
                    </div>
                
            </div>

        )
    }
}
